import React from "react";

export const Footer = () => {
  return (
    <footer>
      <div>
        <link
          href="https://fonts.googleapis.com/css?family=Expletus Sans"
          rel="stylesheet"
        ></link>
        <div className="text-5xl ... font-sans">Совет Старшеклассников</div>
      </div>
      <div></div>
    </footer>
  );
};
